import React from 'react';
import styles from '../styles/Projects.module.css';

const Projects = () => {
    const projects = [
        {
            id: 1,
            title: "Alzheimer Detection with CNN",
            image: "/project1.jpg", // Restauramos las imágenes
            description: "Deep learning model using convolutional neural networks to detect Alzheimer's patterns in MRI brain scans.",
            technologies: ["Python", "TensorFlow", "Keras", "OpenCV"],
            link: "/projects/alzheimer"
        },
        {
            id: 2,
            title: "Hospital Data Warehouse", 
            image: "/project2.jpg",
            description: "Comprehensive ETL pipeline and data warehouse solution for US hospital data analysis.",
            technologies: ["SQL Server", "Power BI", "Apache NiFi", "Python"],
            link: "/projects/hospital"
        },
        {
            id: 3,
            title: "Health Data Analytics",
            image: "/project3.jpg", 
            description: "Web platform for healthcare data visualization and analysis using modern technologies.",
            technologies: ["React", "Node.js", "MongoDB", "D3.js"],
            link: "/projects/analytics"
        }
    ];

    return (
        <div className={styles.projectsPage}>
            <div className={styles.container}>
                <div className={styles.projectsHeader}>
                    <h1 className={styles.pageTitle}>Projects</h1>
                    <p className={styles.subtitle}>
                        Here are some of my recent projects in data science and healthcare technology.
                    </p>
                </div>

                <div className={styles.projectsGrid}>
                    {projects.map((project) => (
                        <div key={project.id} className={styles.projectCard} onClick={() => window.location.href = project.link}>
                            <div className={styles.projectImage}>
                                <img src={project.image} alt={project.title} />
                            </div>
                            <div className={styles.projectContent}>
                                <h3 className={styles.projectTitle}>{project.title}</h3>
                                <div className={styles.projectTech}>
                                    {project.technologies.map((tech, index) => (
                                        <span key={index} className={styles.techTag}>
                                            {tech}
                                        </span>
                                    ))}
                                </div>
                                <p className={styles.projectDescription}>{project.description}</p>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
};

export default Projects;
